import React from "react";
import { withStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";

const styles = theme => ({
  HPSBlue: {
    backgroundColor: "#1C80B5",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "18px",
    margin: theme.spacing.unit,
    color: "#FFFFF"
  },
  default: {
    backgroundColor: "#F0F0F0",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "18px",
    margin: theme.spacing.unit,
    color: "#999794"
  },
  card: {
    maxWidth: 1080
  }
});
class LineOfBusiness extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      health1: false,
      dental1: false,
      vision1: false,
      travel1: false,
      individual: false
    };
  }
  changeColor = () => {
    if (this.state.individual === true) {
      this.setState({ individual: false });
    } else this.setState({ individual: true });
  };
  changeHealth1 = () => {
    if (this.state.health1 === true) {
      this.setState({ health1: false });
    } else this.setState({ health1: true });
  };
  changeDental1 = () => {
    if (this.state.dental1 === true) {
      this.setState({ dental1: false });
    } else this.setState({ dental1: true });
  };
  changeVision1 = () => {
    if (this.state.vision1 === true) {
      this.setState({ vision1: false });
    } else this.setState({ vision1: true });
  };
  changeTravel1 = () => {
    if (this.state.travel1 === true) {
      this.setState({ travel1: false });
    } else this.setState({ travel1: true });
  };
  render() {
    const { classes } = this.props;
    return (
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "100vh"
        }}
      >
        <Card className={classes.card}>
          <CardContent>
            <Button
              variant="outlined"
              onClick={this.changeHealth1}
              className={
                this.state.health1 === true ? classes.HPSBlue : classes.default
              }
            >
              Health
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeDental1}
              className={
                this.state.dental1 === true ? classes.HPSBlue : classes.default
              }
            >
              Dental
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeVision1}
              className={
                this.state.vision1 === true ? classes.HPSBlue : classes.default
              }
            >
              Vision
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeTravel1}
              className={
                this.state.travel1 === true ? classes.HPSBlue : classes.default
              }
            >
              Travel
            </Button>
          </CardContent>
          <CardContent>
            <Button
              variant="outlined"
              onClick={this.changeColor}
              className={
                this.state.individual === true
                  ? classes.HPSBlue
                  : classes.default
              }
            >
              individual
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeColor}
              className={
                this.state.individual === true
                  ? classes.HPSBlue
                  : classes.default
              }
            >
              individual
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeColor}
              className={
                this.state.individual === true
                  ? classes.HPSBlue
                  : classes.default
              }
            >
              individual
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeColor}
              className={
                this.state.individual === true
                  ? classes.HPSBlue
                  : classes.default
              }
            >
              individual
            </Button>
          </CardContent>
          <CardContent>
            <Button
              variant="outlined"
              onClick={this.changeColor}
              className={
                this.state.individual === true
                  ? classes.HPSBlue
                  : classes.default
              }
            >
              individual
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeColor}
              className={
                this.state.individual === true
                  ? classes.HPSBlue
                  : classes.default
              }
            >
              individual
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeColor}
              className={
                this.state.individual === true
                  ? classes.HPSBlue
                  : classes.default
              }
            >
              individual
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeColor}
              className={
                this.state.individual === true
                  ? classes.HPSBlue
                  : classes.default
              }
            >
              individual
            </Button>
          </CardContent>
          <CardContent>
            <Button variant="outlined">Clear All</Button>
          </CardContent>
        </Card>
      </div>
    );
  }
}
export default withStyles(styles)(LineOfBusiness);
